{
  "tableName": "订单款项分账比例表",
  "remark": "<div style=\"margin-left:20px;\">\n      <div style=\"color:red;font-weight:700\">数据说明:</div>\n      ①收款类型有且只有以下4种（销售收款、品牌公司收款、设计收款、生产收款），即每个经销商编号都可以设置最大4种收款类型（注意：同一个经销商的多个收款类型的分账比例之和需等于1，否则收款部分会出错）；（例如：CS01经销商   销售收款 0.15，品牌公司收款0.1，设计收款0.05，生产收款0.7）<br/>\n② 同一个经销商的收款会分为 “下单、发货”这两个环节，每个环节的总收款比例设置在经销商表内完成；<br/>\n③经销商信用额度（可分别应对对每个收款类型中的多个公司），且分为（“下单信用额度”与“发货信用额度”）请注意这个设置很重要；\n    </div>",
  "remark1": "<div style=\"margin-left:20px;\">\n      <div style=\"color:red;font-weight:700\">多个收款类型及公司可以解决集团公司内部的众多问题：</div>\n      ① 税务成本高：传统一个公司收款时候所有资金直接进入您的对公账户，会大大的增加了您的运营税，如果这些款项不直接进入您的对公账户的话，您的对公账户只收取对应的款项的话，您将大大节省不合理的税务开支；\n      <br />② 合规性：您在销售经营过程中，存在着代收代付的情况，即经销商把货款交给您，您再和销售公司、设计公司、品牌公司之间结算，这个就存在<a href=\"https://www.sohu.com/a/168744298_616434\" target=\"_blank\" style=\"color: blue;\">资金二清</a>问题，是违规的，最好是采用分账模式，将收款和代付做个闭环，您不碰非您所得的资金就可以解决合规性问题了；\n      <br />③税务平衡：同一收款类型中可以设置多个公司来进行收款，您可以随时修改收款公司来分摊每个公司的营业额，降低企业所得税；\n    </div>",
