  "remark": "概述：雕刻机部件分解公式表是将系统详单（详单表）按照公式自定义匹配条件自动拆解决为需要的雕刻机加工部件（如门皮）；\n\n\n\n\n\n",
  "remark1": "<br>注释：\n<br>1、公式表字段主要分为两部分，一是匹配条件字段（参与匹配的订单、组单、详单等字段值）；二是输出结果（自定义值），以下列出输出结果，除开输出结果字段、ID、序号均为匹配条件；\n<br>2、匹配条件字段用于表示复杂的逻辑组合条件的。一个表中可以有一个或者多个逻辑字段，逻辑字段之间的逻辑关系为“并且”。比如该表中如果型号为SR3002,分类为实木，单价为100，就表示当型号为SR3002,并且分类为实木时，单价取值为100。自定义逻辑字段的取值方式规定如下，并按以下顺序判断：\n<br>1.字段里没有任何内容（字段为空），表示该字段被组合条件忽略，或者不考虑该字段。\n<br>2.\"空\"(即字段的内容是一个汉字“空”)，表示该字段必需为空 \n<br>3.\"非空\"(即字段的内容是为两个汉字“非空”)，表示该字段必需非空 \n<br>4.字段中的值可以有多个,用逗号分开,比如:SR3002,SR3001,表示取值为SR3002,SR3001中的任何一个。每个值的最后可跟一个星号，比如SR3*，表示取值为SR3或者以SR3开头的所有值。\n<br>5.条件字段的值举例说明：\n<br>例A：\"SR3002,SR3001\"表示必须是SR3002或者SR3001中的一个。\n<br>例B:  \"非SR3002,SR3001\"表示必须不是SR3002和SR3001中的任何一个。\n<br>例C：\"SR3*,SC3001\"表示必须是SR3开头的所有或者SC3001中的一个。\n<br>例D：\"非SR3*,SC3001\"表示例C的反面。\n<br>例D：\"非空\"表示值不能为空。\n<br>例E：\"空\"表示值必须为空。\n<br>例F: 空表示任意值\n<br>倒G：\"*\"同例F，表示任意值\n\n<br>注意，条件字段中的逗号必须是英文的半角符号，不能是中文的全角符号！。\n<br>输出结果字段：部件类型、部件名称、数量、数量单位、部件尺寸、机器码类型、部件备注；",
